export const Card = ({ name, background_image, genres }) => {
  return (
    <div className={style?.containt}>
      <div>
        {/* <img src={background_image} className={style.image} alt="" /> */}
        <div className={style.text}>
          <h2>Name: {name}</h2>
          <h2>Genres: {genres}</h2>
        </div>
      </div>
    </div>
  );
};
